import React from "react";
import { Button } from "semantic-ui-react";


const index = (props) => {
    return (
        <div className="text-center mt-6">
            <p className="text-2xl">Successfully signed up!</p>
            <p className="">Please check your email.</p>
            <Button>Login</Button>
        </div>
    )
}

export default index
